    "title": "Easy Korean Sticky Chicken",
    "description": "The sweet and spicy flavors of this dish echo Korean fried chicken wings, but without the hassle of deep frying. Look for gochujang, a sweet and spicy Korean red pepper paste, in the International aisle of many grocery stores, at an Asian market, and online. The recipe is a Yummly original created by [Julia Lee](https://www.yummly.com/dish/author/Julia-Lee).",
    "images": {
      "main": "https://lh3.googleusercontent.com/GrQx2bXJfqWsY5J9YVQdjixy0Mi675_bCLmV10_jSPJeVLLBgHuBk3or8gb95lsMYTmZMiYT8omiZYdB_64crHtCxVdL8dEpKd1m",
      "others": {
        "hostedLargeUrl": "https://lh3.googleusercontent.com/ei5eF1LRFkkcekhjdR_8XgOqgdjpomf-rda_vvh7jIauCgLlEWORINSKMRR6I6iTcxxZL9riJwFqKMvK0ixS0xwnRHGMY4I5Zw=s360",
        "resizableImageUrl": "https://lh3.googleusercontent.com/GrQx2bXJfqWsY5J9YVQdjixy0Mi675_bCLmV10_jSPJeVLLBgHuBk3or8gb95lsMYTmZMiYT8omiZYdB_64crHtCxVdL8dEpKd1m",
