    "title": "Quick and Easy Italian Meatballs",
    "description": "Tender meatballs just like your Italian grandma would make, in a fraction of the time. A simple mix of ground beef, seasonings, and Parmesan cheese form these meatballs that get baked in the oven before taking a quick simmer in your favorite marinara sauce.",
    "images": {
      "main": "https://lh3.googleusercontent.com/z7jNUZH4FkOZNwgB1yloPvacmlhmI5-h1ftZkisNcptFDOGDI9Azm36uZOSgOQr9HGvKedvqHZ7Na7CSX4sLYQ5a9ecY3c0ubOk",
