    "title": "Perfect Crispy Baked Chicken Wings",
    "description": "With these crispy chicken wings baked right in the oven, save yourself the mess of frying. The recipe is a Yummly original created by [Sara Mellas](https://www.yummly.com/dish/author/Sara%20Mellas).",
    "images": {
      "main": "https://lh3.googleusercontent.com/IcoIwfNbn7OhI-GWj_WpK8Bc7ivTgCcoZeb0geCW0bB0KPZ0vUzGv8PFYG7c3Cxwx98I7HaGAVUGJ676LH0abGHar0SfEF6VjNN3",
      "others": {
        "hostedLargeUrl": "https://lh3.googleusercontent.com/p4Sr2ys9HKjdJ34iLZykU6xcF2En7bQ8Ac8HOQ8J4Um3nUVk_hwae_ElI0m3VtZpA4_qHiprvWwpDQqc5sI-SWZIrTXEiMHNd6O-=s360",
        "resizableImageUrl": "https://lh3.googleusercontent.com/IcoIwfNbn7OhI-GWj_WpK8Bc7ivTgCcoZeb0geCW0bB0KPZ0vUzGv8PFYG7c3Cxwx98I7HaGAVUGJ676LH0abGHar0SfEF6VjNN3",
        "resizableImageHeight": 1875,
        "resizableImageWidth": 2500
