    "content": {
      "text": [
        "Preheat the oven to 425°F.",
        "Line a large baking sheet with aluminum foil and place a roasting rack on top. Cover the rack with another sheet of aluminum foil and spray with nonstick cooking spray. Use a knife to poke holes all over the foil.",
        "Place the olive oil, salt, black pepper, paprika, and garlic powder in a large mixing bowl. Pat the chicken wings dry with paper towels and add to the bowl. Using a rubber spatula, toss to coat evenly in the seasonings.",
        "Arrange chicken wings on the foil-covered roasting rack.",
        "Bake the chicken wings on middle rack of oven until browned and crispy, 45-50 minutes.",
        "Check to see that chicken wings are done. Remove from oven or add time as needed.",
        "Allow the chicken wings to cool on roasting rack for 3 minutes. Plate and serve immediately."
