  {
    "id": "6f684748-9473-46f2-8fc9-34db69a5065d",
    "title": "Easy Baked Spaghetti",
    "description": "This hearty spaghetti casserole bakes with meat sauce and a creamy layer of ricotta cheese. If you're a fan of crispy edges, you can bake it in a 9 1/2- or 10-inch-wide Bundt pan instead of the casserole dish, and the whole thing will have those wonderful edges! (Allow the same amount of time for baking, about 40 minutes covered and 15 minutes uncovered.) The recipe is a Yummly original created by [Sara Mellas](https://www.yummly.com/dish/author/Sara%20Mellas).",
    "images": {
      "main": "https://lh3.googleusercontent.com/rHSCbj--ESaW5NtsT4az7bIfcFpnb_ziTptGuXfzz89BxObu7enaV8oVxATIYHdiNNSJqUV5Us0dkHaXYp3pcIqb6BeY_Xwj-A",
      "others": {
        "hostedLargeUrl": "https://lh3.googleusercontent.com/Vnf2SAW-FXNmRgi4vsTvKIfqlixvsO56pobp8gVppY--fo55_O22JYbKtwn-jrx5KDynmJFCPj4_VeClJdwLAinmaDdm2ajTodUz=s360",
        "resizableImageUrl": "https://lh3.googleusercontent.com/rHSCbj--ESaW5NtsT4az7bIfcFpnb_ziTptGuXfzz89BxObu7enaV8oVxATIYHdiNNSJqUV5Us0dkHaXYp3pcIqb6BeY_Xwj-A",
        "resizableImageHeight": 1400,
        "resizableImageWidth": 1400
      }
    },
    "content": {
      "text": [
        "Preheat the oven to 375°F.",
        "Spray a 9x13-inch baking dish with nonstick cooking spray. Set aside.",
        "Bring a large pot of water to a boil. Add a generous pinch of salt. Once boiling, add the spaghetti to the water. Cook, stirring occasionally, until the pasta is al dente, 9-10 minutes. Drain the pasta in a large colander, and rinse thoroughly with cold water. While the pasta cooks, prepare the meat sauce.",
        "Spray an extra-large skillet generously with nonstick cooking spray, then set over medium-high heat. Add the ground beef, salt, black pepper, garlic powder, and Italian seasoning to the skillet. Cook the beef, breaking it up with a spatula, until thoroughly browned, 5-6 minutes.",
        "Drain the fat from the skillet. Return the skillet to the stove, and reduce heat to medium-low. Pour the marinara sauce over the meat and stir to combine. Cover and simmer for 2-3 minutes. While the sauce simmers, prepare the cheese mixture.",
        "Place the ricotta, Parmesan, salt, black pepper, garlic powder, and Italian seasoning, the mozzarella cheese in a large mixing bowl. Stir with a rubber spatula to thoroughly combine.",
        "Return the drained spaghetti to the pot. Add the meat sauce and stir to thoroughly coat the noodles.",
        "Transfer half of the sauced pasta to the prepared baking dish. Drop the ricotta mixture by spoonfuls over the spaghetti, and gently spread it into an even layer. Sprinkle half the mozzarella over the top. Cover with the remaining noodles. Sprinkle the remaining mozzarella cheese in an even layer over the top of the dish.",
        "Cover the baking dish with a sheet of aluminum foil.",
        "Bake the spaghetti on middle rack of oven for 40 minutes.",
        "Remove the aluminum foil and continue baking until cheese on top is golden brown, about 15 minutes.",
        "Check to see that spaghetti is done. Remove from oven or add time as needed.",
        "Allow the spaghetti to rest for 20 minutes before serving. Scatter fresh basil leaves on top if you like."
      ],
      "vidoes": {
        "ios": "https://gv.yummlystatic.com/173de414-2119-4fbf-869b-9886aca552f4/4wkW0TJYQJCmwO40NSX2_Montage_Easy_Baked_Spaghetti/hls.m3u8",
        "android": "https://gv.yummlystatic.com/173de414-2119-4fbf-869b-9886aca552f4/4wkW0TJYQJCmwO40NSX2_Montage_Easy_Baked_Spaghetti/dash.mpd",
        "original": "https://s3.amazonaws.com/videos-yummly/4wkW0TJYQJCmwO40NSX2_Montage_Easy_Baked_Spaghetti.mp4",
        "created_time": "2021-06-03T02:20:56Z"
      },
      "ingredients": [
        {
          "category": "Baking & Cooking",
          "items": [
            {
              "name": "nonstick cooking spray",
