  {
    "id": "adcef72f-28bf-407c-b112-64d8d9f1d750",
    "title": "Garlic Roasted Cauliflower",
    "description": "Perfectly roasted cauliflower with garlicky flavor in every bite. The recipe is a Yummly original created by [Sara Mellas](https://www.yummly.com/dish/author/Sara%20Mellas).",
    "images": {
      "main": "https://lh3.googleusercontent.com/tnWFcP5OaStB1ayXnhX6t--2LJa04me3G_mWMwj9RpdVhZGTrF4K2jdwaUvggR6xQgaCHPKDOMi2MtHME1Q7dXLWGFWr7CMlUA",
      "others": {
        "hostedLargeUrl": "https://lh3.googleusercontent.com/K0CDq-Do1SntjNsbW90xXDzOL2IefjNdJPWCu509xaR_V4JGlAHKf1KRCBf1Xmf0XbDYn36LDUgpXOIQvDvUS6u5Ejx7J2iuZHch=s360",
        "resizableImageUrl": "https://lh3.googleusercontent.com/tnWFcP5OaStB1ayXnhX6t--2LJa04me3G_mWMwj9RpdVhZGTrF4K2jdwaUvggR6xQgaCHPKDOMi2MtHME1Q7dXLWGFWr7CMlUA",
        "resizableImageHeight": 1365,
        "resizableImageWidth": 1365
      }
    },
    "content": {
      "text": [
        "Preheat the oven to 400°F.",
        "Line a large baking sheet with parchment paper.",
        "Make sure the cauliflower florets are roughly 1 inch wide, and arrange them on the baking sheet.",
        "Drizzle the cauliflower with olive oil. Sprinkle with salt and black pepper.",
        "Use a rubber spatula to toss the cauliflower until it is evenly coated in the oil.",
        "Roast on middle rack of oven for 15 minutes. While the cauliflower roasts, finely mince the garlic cloves.",
        "Open the oven and sprinkle the garlic over the cauliflower. Toss lightly with a rubber spatula to distribute the garlic. Continue roasting until garlic is fragrant and cauliflower is crisp-tender, 8-10 minutes.",
        "Check to see that cauliflower is done. Remove from oven or add time as needed.",
        "Serve immediately."
