  {
    "id": "8ce722c4-7db4-4106-88cf-f063d8bfc01d",
    "title": "The Best Southern Fried Chicken",
    "description": "Here’s the Southern-style buttermilk fried chicken of your dreams, and the traditional soul food dish, extra crispy on the outside, juicy on the inside, and seasoned to perfection. The secrets: For tenderness, marinate the chicken in buttermilk. For a crispy coating, include cornstarch in the dredging mixture, let the coating stand until pasty before frying, and drain the chicken on a rack rather than paper towels. This recipe uses a whole cut-up chicken, split into breasts, drumsticks, wings, and thighs. However, you can also pick your favorite parts such as the thigh or breast only. Though you can marinate the chicken for as little as 3 hours, you can go up to 24 hours, and the chicken will get extra tender and absorb more buttermilk flavor. The recipe is a Yummly original created by Marrekus and Krysten Wilkes of [Cooks with Soul](https://www.yummly.com/dish/author/Cooks-with-Soul).\n",
    "images": {
      "main": "https://lh3.googleusercontent.com/zrxZIlRq-vCfo-wvPZ8tY5Q352FW8ZHInvj3qmvHVgMYVUsJERg7TNNZ--tqkAhw7Fkp4J3FlRgJ4i1CdyGADEIZkZCbkfWv5E0L",
      "others": {
        "hostedLargeUrl": "https://lh3.googleusercontent.com/48yooiijusX6gdwQ2_m0NfMGhxmaV2JQnPmc83llTCJPbk9zgGTlJc8uWGs9TjeYik9SpHHOYbOI2FLaYRWrdTsPi-SXMd2B2A=s360",
        "resizableImageUrl": "https://lh3.googleusercontent.com/zrxZIlRq-vCfo-wvPZ8tY5Q352FW8ZHInvj3qmvHVgMYVUsJERg7TNNZ--tqkAhw7Fkp4J3FlRgJ4i1CdyGADEIZkZCbkfWv5E0L",
        "resizableImageHeight": 4480,
        "resizableImageWidth": 4480
      }
    },
    "content": {
      "text": [
        "Cut chicken breasts in half if they’re large. Combine buttermilk and hot sauce in a large bowl or zip-top bag. Place chicken in bowl and stir until chicken is completely coated. (If using a zip-top bag, seal bag, then set it in a large bowl to prevent possible spills.)",
        "Cover bowl and let chicken marinate in the refrigerator for at least 3 hours and up to 24 hours.",
        "Put flour, cornstarch, salt, granulated garlic, granulated onion, chili powder, and sazón in a large brown paper bag and toss to combine. Alternatively, use a medium-sized bowl and whisk ingredients to combine. Set aside.",
        "Fill a Dutch oven with about 2 inches of oil and heat over medium heat to 340°F on a deep-frying thermometer. (While some recipes recommend 350°F, going with 340°F keeps the chicken from getting too dark before it’s done in the middle.)",
        "Meanwhile, preheat oven to the lowest temperature. Set a wire rack on a sheet pan. Remove chicken from the bowl of buttermilk brine and let excess buttermilk drip off. Dip 1 chicken piece at a time into the flour mixture, making sure that the chicken is coated well. Press the chicken in the flour to help develop a nice crunchy crust. Shake off excess and set chicken on the wire rack. Repeat with the rest of the chicken. Rest battered chicken on the rack until it starts to turn pasty, 3-5 minutes.",
        "Carefully add 2 or 3 pieces of chicken to the hot oil, 1 piece at a time, using tongs. Fry in batches to prevent overcrowding and temperature drop.",
        "Fry chicken, turning every few minutes, until it’s golden brown and an instant-read thermometer reaches at least 165°F in the thickest part, 8-10 minutes for white meat (or a little longer if pieces are big) and 12-14 minutes for dark meat.",
        "When chicken is done, transfer it to a clean wire rack set in another sheet pan to drain, and keep warm in oven until all the batches are cooked. Serve immediately."
      ],
