    "title": "Restaurant-Style Loaded Chicken Nachos",
    "description": "With spiced ground chicken, hearty black beans, and tons of toppings, these homemade nachos are sure to make your mouth water! The recipe is a Yummly original created by [Sara Mellas](https://www.yummly.com/dish/author/Sara%20Mellas).",
    "images": {
      "main": "https://lh3.googleusercontent.com/4BTIA6SXYUYVCuzZR7iDQM21_aRM_fiom6gZHjxFx9pfKBBaYzFFV6m2KyayspPWLeOBvxBRNXIe6KiWxaHl6Hpkz6w2K90K5wm7",
      "others": {
        "hostedLargeUrl": "https://lh3.googleusercontent.com/157UBYSkUID9RGz_-kGgTtPFmritkyhykzvRrZQXwCzFAE7ueqK5eJB58NTGIFrOrlEuG5EzOVLuUBrArg8oHBpAWF9De1C5dLI=s360",
