  {
    "id": "29b28649-2bac-47d8-96d2-42fba4f80f0d",
    "title": "Crispy Sesame Tofu and Broccoli",
    "description": "In less time than it takes to order and bring home take-out, you can pan-fry tofu until crisp, simmer broccoli florets, and bring them together with a lightly sweet soy and sesame sauce (which is generous enough to spoon over rice). Whether you're cooking vegetarian or gluten-free, or you just want a healthy choice, this one's a keeper for weeknight dinners. The recipe is a Yummly original created by [Sara Mellas](https://www.yummly.com/dish/author/Sara%20Mellas).",
    "images": {
      "main": "https://lh3.googleusercontent.com/8PernMZxm2G4jr_G9nU190C0PXWz0mnkO2hvHQxQ4xta4phEp7qpFbYqdIWTmh4ih12Kw7wULdEOLwnccmNlNbtrnsxdvWy6KBU",
      "others": {
        "hostedLargeUrl": "https://lh3.googleusercontent.com/KoLzylz_GVDNwzAz620_Ak3hOCqemmWrXJf1skAGc_WD5O_TD5Q-dPWJKynj02eb3oFqDHivcwFZRmuthbogoLL9Oe4oxixcHZ_J=s360",
        "resizableImageUrl": "https://lh3.googleusercontent.com/8PernMZxm2G4jr_G9nU190C0PXWz0mnkO2hvHQxQ4xta4phEp7qpFbYqdIWTmh4ih12Kw7wULdEOLwnccmNlNbtrnsxdvWy6KBU",
        "resizableImageHeight": 1730,
        "resizableImageWidth": 1730
      }
    },
    "content": {
      "text": [
        "Drain any water from the package of tofu. Wrap the block of tofu in 3-4 layers of paper towels, tucking in the sides so the block is fully wrapped. Set on a work surface, place a heavy-bottomed pan on top of the block, and let it sit for at least 30 minutes.",
        "To make the sauce: Mince the garlic and finely grate ginger. Whisk together the water and cornstarch in a medium mixing bowl until cornstarch is fully dissolved. Add the tamari, brown sugar, rice vinegar, sesame oil, garlic, ginger, and crushed red pepper (if using). Set sauce aside. Thinly slice the scallions and set aside.",
        "Unwrap tofu and discard paper towels. Cut tofu into rectangles approximately 1 inch long, 3/4 inch wide, and 1/2 inch thick. Put tofu in a large bowl and sprinkle with the salt, black pepper, and cornstarch. Toss with a spatula to coat.",
        "Set a large nonstick frying pan over medium-high heat and add the oil. Once oil is shimmering, add half the tofu pieces, using tongs to ensure they lie flat in a single layer on bottom of pan. Sear tofu until bottoms are golden brown and crisp, 3-4 minutes. Flip tofu and sear the opposite sides until golden brown, about 3 minutes.",
        "Transfer tofu to a plate. Repeat with more oil and the remaining tofu.",
        "Reduce heat to medium. Add the broccoli to pan and pour in the water. Cover pan and simmer broccoli until it is bright green and tender-crisp, 2-3 minutes.",
        "Transfer broccoli to a plate and discard any residual water from pan.",
        "Return frying pan to stove over medium heat. Pour sauce into pan and cook, stirring, until it begins to bubble and thicken, 1-2 minutes. Add broccoli to bubbling sauce and stir to coat, then stir in tofu. Continue cooking just until the ingredients are fully heated through, 1-2 minutes longer.",
        "Sprinkle reserved scallions and the sesame seeds over tofu and broccoli and serve immediately."
      ],
