    "title": "Baked Greek Chicken with Fresh Lemon and Dill",
    "description": "An easy baked chicken gets a boost from fresh lemon, dill, and garlic in this Mediterranean-inspired dish. There is a generous amount of sauce produced during baking, which is perfect spooned over steamed rice or couscous. The recipe is a Yummly original created by [Jennifer Clair](https://www.yummly.com/dish/author/Jennifer-Clair).\n",
    "images": {
      "main": "https://lh3.googleusercontent.com/2jXoqwQxzbtSOzPHs2kSmUwiFIPHc0x7iVuY32XMUk22YFA6dqPNkGAhbz6prLi0OAJi3FFGPDJLCNgbgfkdhwAlPLnC3zBfZRxu",
      "others": {
        "hostedLargeUrl": "https://lh3.googleusercontent.com/CkqZyRT3wDw1NWQeXdBSEkPVaIqsbzDNp091Lls8X7ZRbINXOsx0U_URMl5nYe-pkjILeRjpPHotwbcSo3Ngtmj35GjvVfNr8I4=s360",
        "resizableImageUrl": "https://lh3.googleusercontent.com/2jXoqwQxzbtSOzPHs2kSmUwiFIPHc0x7iVuY32XMUk22YFA6dqPNkGAhbz6prLi0OAJi3FFGPDJLCNgbgfkdhwAlPLnC3zBfZRxu",
        "resizableImageHeight": 1400,
        "resizableImageWidth": 1400
      }
    },
    "content": {
      "text": [
        "Preheat the oven to 375°F.",
        "Mince the garlic, chop the dill, and juice the lemons. Set ingredients aside. Season the chicken with salt and pepper.",
        "Heat the oil in a large, ovenproof frying pan over medium-high heat. Add chicken skin side down and cook until deep golden brown, about 8 minutes. Meanwhile, make the sauce.",
        "In a small bowl, combine the lemon juice, olive oil, garlic, half the chopped dill, and the salt. Set aside.",
        "Turn chicken skin side up in frying pan. Reserve about 3 tablespoons of drippings in the pan and discard any extra. Stir lemon sauce and pour over chicken.",
        "Bake the chicken on middle rack of oven until cooked through, and the thickest part registers 165°F on an instant-read thermometer, about 20 minutes.",
        "Check to see that chicken is done. Remove from oven or add time as needed.",
        "Scatter the dill sprigs over chicken. Serve chicken in the sauce, and the remaining chopped dill on the side."
      ],
