    "title": "Cast Iron Skillet Scalloped Potatoes with Shallots",
    "description": "There is a picture of these Cast Iron Skillet Scalloped Potatoes with Shallots next to the word \"indulgent\" in the dictionary.  Surprisingly, it's also next to the word \"easy\"!  They are so creamy, cheesy and rich, they make any meal special, but you only need a handful of pantry ingredients and 20 minutes of prep before they're oven ready.  The secret to this scalloped potatoes recipe is the cream of mushroom soup that melts to create a smooth sauce, layered with shredded Swiss cheese.  The potatoes and shallots cook down in the sauce until they're fork-tender.  Don't have shallots?  In a pinch, you can substitute yellow onion, just make sure to cook until very tender in the first step. Try it today- your whole family will love these cheesy scalloped potatoes.",
