  {
    "id": "aa963306-96d9-4777-9b18-4414ce4b6550",
    "title": "Favorite Indian Lentils and Spinach (Dal Palak)",
    "description": "Known as dal palak in India, this much-loved everyday meal involves cooking lentils very simply with a little turmeric and spinach, then giving them a big flavor boost with a tarka — an infusion of spices and ghee (clarified butter). It's Indian comfort food at its best. The recipe is a Yummly original created by [Prerna Singh](https://www.yummly.com/dish/author/Prerna-Singh).",
    "images": {
      "main": "https://lh3.googleusercontent.com/QsHsO7v7qiEjLluVYWeGOFaD6uwPEaZj68_utnGB7Xo6303zZjXVSzbZz8HIUtVJ2ZzGlJgoONlPjSkxjaANfBa2XtfEZVOPxkr1",
      "others": {
        "hostedLargeUrl": "https://lh3.googleusercontent.com/jJ-wY1nVmRNoU2U1kZkJnDajGNRa9dfvylSq7VsVLGZ4Oyi8Gq1z7txnyHOqPN_TA8TzXsjo0xHdk1ev-z4k5VgyVHT71t60LwDy=s360",
        "resizableImageUrl": "https://lh3.googleusercontent.com/QsHsO7v7qiEjLluVYWeGOFaD6uwPEaZj68_utnGB7Xo6303zZjXVSzbZz8HIUtVJ2ZzGlJgoONlPjSkxjaANfBa2XtfEZVOPxkr1",
        "resizableImageHeight": 1400,
        "resizableImageWidth": 1400
      }
    },
    "content": {
      "text": [
        "Rinse the lentils well in a fine strainer under running water. Coarsely chop the spinach.",
        "Put lentils and spinach in a medium to large saucepan and add the water, salt, and turmeric. Bring to a boil over high heat; then cover, reduce heat to low, and cook, stirring occasionally, until lentils are tender, about 45 minutes. Remove from heat.",
        "Mince the garlic. Heat the ghee in a small saucepan over medium heat. Reduce heat and add the asefetida, if using, and cumin seeds. As soon as they sputter, add minced garlic. Cook garlic until it begins to turn golden, about 1 minute. Add the chilies, paprika, and garam masala and briefly stir. Turn the heat off and pour the tarka (spiced ghee) over the dal. Stir well.",
        "Chop the cilantro, if using. Scatter it over dal and serve with basmati rice if you like."
