  {
    "id": "f24d2809-3eaa-46ff-a991-41b87d33a8b8",
    "title": "Hearty Italian Beef and Vegetable Soup",
    "description": "Lean ground beef, lots of veggies, and cannellini beans combine to make a satisfying and healthy soup that comes together fast. We added tender Swiss chard at the end for a shot of green, but you could substitute lacinato kale or spinach instead. Serve the soup sprinkled with Parmesan cheese, and offer garlic bread on the side. The recipe is a Yummly original created by [Ivy Manning](https://www.yummly.com/dish/author/Ivy-Manning).",
    "images": {
      "main": "https://lh3.googleusercontent.com/AG570X5v4u3yzAkTy2fgxSlAm6xWowCfMUxjvw2UYI6rJxpHeL9Wo5aC12sLY6_GjdyC6S15-eXc7smqEcm7uw",
      "others": {
        "hostedLargeUrl": "https://lh3.googleusercontent.com/JyPg6_pQIUBHqVl060WUEi4cTEwGcgCvgMTfdulNO6MOubJncKiSFwy__GxUiBa1GFuiC7xXkSZn-CQHjIl2Vw=s360",
        "resizableImageUrl": "https://lh3.googleusercontent.com/AG570X5v4u3yzAkTy2fgxSlAm6xWowCfMUxjvw2UYI6rJxpHeL9Wo5aC12sLY6_GjdyC6S15-eXc7smqEcm7uw",
        "resizableImageHeight": 1080,
        "resizableImageWidth": 1920
      }
    },
    "content": {
      "text": [
        "Chop onion and garlic. Peel and chop the carrots, and chop the celery. Set carrots and celery aside.",
        "Saute the beef and onion in a Dutch oven over medium-high heat, stirring frequently to break up meat, until beef is cooked through and onion is translucent, about 6 minutes. Add the tomato paste, garlic, and Italian seasoning and cook, stirring constantly, until fragrant, about 45 seconds.",
        "Add the broth, tomatoes, carrots, and celery to pot. Rinse and drain the cannellini beans and stir them into pot. Bring soup to a simmer over high heat, cover, reduce heat to low, and simmer until vegetables are tender, about 15 minutes. Meanwhile, prepare the chard.",
        "Strip chard leaves from center ribs with your fingers, and reserve ribs for another use. Coarsely chop the leaves.",
        "Stir chopped chard into soup and simmer, uncovered, until tender, about 5 minutes.",
        "Remove soup from heat. Season to taste with the salt and pepper. Ladle into bowls and serve with Parmesan. Cooled soup can be refrigerated for up to 3 days."
