    "title": "Keto Italian Meatballs",
    "description": "These super-moist beef meatballs are completely grain-free and keto diet-friendly. Try them on their own in marinara sauce, or with cooked spaghetti squash or barely cooked zoodles instead of traditional pasta. The recipe is a Yummly original created by [Sara Mellas](https://www.yummly.com/dish/author/Sara%20Mellas).",
    "images": {
      "main": "https://lh3.googleusercontent.com/IrmiuFptb5vvJVmJ2ZgIz0ckRSul5BcJBvsINtdq1Xoq6H9AOdU6ZNaEz5HaKp7RBC5nOcmCcIkShqTG5Uein6ob6iBG3fMwug",
      "others": {
        "hostedLargeUrl": "https://lh3.googleusercontent.com/fz7D_jICLiCGZlYrOa5g8CACouC1qdWHpLEhjQ3U4z043rmvN7NWgRFPCxoCDCp9tMp9DXjlqQ4j-AtBdTPVvIQz3vpgLDl6Y21d=s360",
        "resizableImageUrl": "https://lh3.googleusercontent.com/IrmiuFptb5vvJVmJ2ZgIz0ckRSul5BcJBvsINtdq1Xoq6H9AOdU6ZNaEz5HaKp7RBC5nOcmCcIkShqTG5Uein6ob6iBG3fMwug",
        "resizableImageHeight": 1666,
        "resizableImageWidth": 1666
      }
    },
    "content": {
      "text": [
        "Preheat the oven to 350°F.",
        "Line a baking sheet with parchment paper. Set aside.",
        "Grate or press the garlic cloves into a large mixing bowl. Add the beef, eggs, almond flour, Italian seasoning, Parmesan, salt, and black pepper. Using clean hands, mix ingredients until just combined.",
        "Roll meat mixture into 24 balls about 1 inch in diameter, or 1.5 oz. each, and place on the prepared baking sheet.",
        "Bake the meatballs on middle rack of oven until cooked through, 16-17 minutes.",
        "Check to see that meatballs are done. Remove from oven or add time as needed.",
        "Transfer the meatballs to a large pot and pour in the marinara sauce. Bring sauce to a simmer over medium heat. Simmer meatballs in sauce until heated through, 3-5 minutes.",
        "Transfer the meatballs and sauce to a serving dish and top with grated Parmesan and fresh basil, if you like. Serve immediately."
