  {
    "id": "ecc817a6-2fdd-46fa-8c75-12b83b0a5acc",
    "title": "Alfajores (Dulce de Leche Cookie Sandwiches)",
    "description": "These delicate dulce de leche sandwich cookies are delicious! The cookies are not too sweet, and they have a delicate, soft, and crumbly texture. Combined with the dulce de leche filling and powdered sugar on top, it is the perfect balance of textures and flavors. The recipe is a Yummly original created by [Erica Dinho](https://www.yummly.com/dish/author/erica-dinho).",
    "images": {
      "main": "https://lh3.googleusercontent.com/v90uiuUmetaB0kyNtoOnbdivhN1kOQTtqW82hYhcL7RbAa3geoL_Ar9UWtoGv6kMVfzGsqPU1263yZoXLYUFjPv1AT46aaIwaQ",
      "others": {
        "hostedLargeUrl": "https://lh3.googleusercontent.com/Xq7XVALWGnu648bETZcMt192BWPro12TiqJYCJo6bq2hMUwdvYZd9LraGGEdA52o1RBQdbxEab0ff3hSIVjGUoBJ4EpshzHR36Y=s360",
        "resizableImageUrl": "https://lh3.googleusercontent.com/v90uiuUmetaB0kyNtoOnbdivhN1kOQTtqW82hYhcL7RbAa3geoL_Ar9UWtoGv6kMVfzGsqPU1263yZoXLYUFjPv1AT46aaIwaQ",
        "resizableImageHeight": 600,
        "resizableImageWidth": 600
      }
    },
    "content": {
      "text": [
        "Preheat the oven to 350°F.",
        "In a large bowl, mix the butter and 1 cup of powdered sugar.",
        "Add the flour, corn starch, and vanilla extract, then mix with your hands until well combined.",
        "Knead together to form a soft dough. Cover with plastic wrap and let stand for 10-15 minutes.",
        "Turn the dough out onto a floured counter and knead for about 2 minutes. Roll out to about 1/4 inch thick and cut out the cookies with a round cookie cutter.",
        "Place them on a floured cookie sheet and bake for about 10-12 minutes. Remove from the oven and let cool on a rack for 10 minutes. In a small plate, place the flaked coconut and set aside.",
        "Spread arequipe (or dulce de leche) on each cookie, then put together two cookies, making a sandwich with the arequipe in the middle of the two cookies. When you put the cookies together you’ll want some arequipe to come out of the sides.",
        "Take the plate with coconut and cover the edges of each alfajor cookie with it, rolling the cookie edge in the flaked coconut if using.",
        "Sprinkle them with powdered sugar and enjoy."
      ],
