    "title": "Creamy Brussels Sprouts with Bacon",
    "description": "This Creamy Brussels Sprouts with Bacon recipe has all the flavors- savory Brussels sprouts, sweet onion and salty bacon, all in a rich creamy sauce.  It's a perfect holiday side, but it's so easy you could make it on a regular weeknight, too!  Only 6 ingredients and it all cooks in one pan, from stove to oven to table!  The cream of mushroom soup pulls it all together, turning the separate ingredients into a delicious, creamy vegetable casserole.  Creamy Brussels Sprouts with Bacon will be one of your most-requested holiday dishes.",
