  {
    "id": "4ec84bc5-31a8-4cec-a05c-403e28ce3187",
    "title": "Roasted Vegetables with Easy Tahini-Miso Sauce",
    "description": "Looking for something a little different? Dip, dunk, or drizzle your way to roasted veggie happiness with this tahini-miso take on a sheet pan classic. The recipe is a Yummly original created by [Edwina Clark](https://www.yummly.com/dish/author/Edwina-Clark).",
    "images": {
      "main": "https://lh3.googleusercontent.com/kZQii2lvJttUuUDq9OnFGakMICGrdLvWW500mcA9bqqmgMdz9Gj4MXnP2wNxnpkv2VSHtKwnL-mllSAZtpLLpAtwytEp5QgKYQ",
      "others": {
        "hostedLargeUrl": "https://lh3.googleusercontent.com/cRRgqV4MykgT-4ok1tgnlRmtxljo3o6J5yg4zWAP5LS02auZ0rS9fvJBF_DhAjr9VLXXb5HUsYRCEPgUa8Z-gg2tZ0eld16llA=s360",
        "resizableImageUrl": "https://lh3.googleusercontent.com/kZQii2lvJttUuUDq9OnFGakMICGrdLvWW500mcA9bqqmgMdz9Gj4MXnP2wNxnpkv2VSHtKwnL-mllSAZtpLLpAtwytEp5QgKYQ",
        "resizableImageHeight": 1080,
        "resizableImageWidth": 1920
      }
    },
    "content": {
      "text": [
        "Preheat the oven to 425F. ",
        "Line a baking sheet with aluminum foil. Spray liberally with nonstick cooking spray.",
        "Cut the bell pepper and white onion into 1/2 inch squares. Separate the onion layers for even cooking.",
        "Crush and finely mince the garlic. ",
        "In a large mixing bowl, combine the minced garlic, salt, and canola oil.",
        "Add the broccoli florets, red bell pepper, and white onion to the bowl. Toss to coat.",
        "Transfer the seasoned vegetables to the prepared baking sheet and spread them into a single layer.",
        "Bake the vegetables on middle rack of oven until they are fork tender, about 25 minutes.",
        "Check to see that vegetables are done. Remove from oven or add time as needed.",
        "Allow vegetables to cool slightly. In the meantime, combine the tahini, miso, warm water, and lemon juice in a small bowl. Season with black pepper to taste, and whisk to combine.",
        "Transfer the vegetables to a serving patter, and drizzle the tahini-miso mixture over them. Serve and enjoy."
      ],
      "vidoes": {
        "ios": "https://gv.yummlystatic.com/cc4MexlTWymItxaFRBtp_Montage_Easy_Roasted_Vegetables_Tahini_Miso/cc4MexlTWymItxaFRBtp_Montage_Easy_Roasted_Vegetables_Tahini_Miso-hls.m3u8",
        "android": "https://gv.yummlystatic.com/cc4MexlTWymItxaFRBtp_Montage_Easy_Roasted_Vegetables_Tahini_Miso/cc4MexlTWymItxaFRBtp_Montage_Easy_Roasted_Vegetables_Tahini_Miso-dash.mpd",
