    "id": "627978d8-adc4-409d-9032-d503a12bf98a",
    "title": "Banana Bread",
    "description": "Super-moist and easy to make, this one-bowl banana bread comes out perfectly every time. The recipe is a Yummly original created by [Sara Mellas](https://www.yummly.com/dish/author/Sara%20Mellas).",
    "images": {
      "main": "https://lh3.googleusercontent.com/9x5tB4Qoxmx2O8XnE7wtp0T2f7b3YOs9ISOOZSWpT0ZHzi_ozYghtXbO4f7NzJg31k_XjdiEbWqkkNR9gaCswSeqm949OJU-2VE",
      "others": {
        "hostedLargeUrl": "https://lh3.googleusercontent.com/O6ilhmRM89scXyvBaYF7lEY4VC_iB3jFlJZ_zRib1pWSKu2I9QLsPjG0jxsVzy88VGJDYmtBIq-ooxwZXyB1itpWimh8VFAnPPQ=s360",
        "resizableImageUrl": "https://lh3.googleusercontent.com/9x5tB4Qoxmx2O8XnE7wtp0T2f7b3YOs9ISOOZSWpT0ZHzi_ozYghtXbO4f7NzJg31k_XjdiEbWqkkNR9gaCswSeqm949OJU-2VE",
        "resizableImageHeight": 1492,
        "resizableImageWidth": 1517
      }
    },
    "content": {
      "text": [
        "Preheat the oven to 350°F.",
        "Spray a 9x5-inch loaf pan with nonstick cooking spray. Set aside.",
        "Place the mashed bananas, canola oil, granulated sugar, brown sugar, eggs, and vanilla extract in a large mixing bowl. Whisk vigorously until smooth and combined.",
        "Add the flour, cinnamon, baking powder, baking soda, and salt to the bowl. Continue whisking until the mixture is just combined. Do not over-mix.",
        "Pour the batter into the prepared loaf pan.",
        "Bake the bread on middle rack of oven until a toothpick inserted in the center comes out clean, 55-65 minutes.",
        "Check to see that bread is done. Remove from oven or add time as needed.",
        "Allow the bread to rest in the pan for 10 minutes, then release from the pan onto a cooling rack. Allow to cool for at least 1 hour before slicing and serving. Leftover bread may be stored in a large zip-top bag at room temperature for 1 day, in the refrigerator for 4 days, or in the freezer for up to 3 months."
      ],
