    "id": "11335fa2-9380-44c6-93ba-1b9429d6d355",
    "title": "Healthy No-Churn Fruit Sorbet",
    "description": "There's no churning necessary for this dairy-free and refined-sugar-free fruit sorbet; 5 minutes and a high-powered blender are all it takes. Feel free to customize the treat depending on the frozen fruit you have on hand and are in the mood for. The recipe is a Yummly original created by [Sara Mellas](https://www.yummly.com/dish/author/Sara%20Mellas).",
    "images": {
      "main": "https://lh3.googleusercontent.com/v-23hPiQYTf_Vj_NxUpW_SG5Zy0MD8b8fYrKdwGteQ4vP3wtISl9hfNi33yt6mzxqFZXhCfF-JJuW3Oq16pY0xI",
      "others": {
        "hostedLargeUrl": "https://lh3.googleusercontent.com/V7uvHnpsjNQKfaNxiSwQe0_6f5h5cIGA5PjljdwkO8B4ivROq6hfHrtKa6pNQIG28ag2tpIg7i3v-Vs2aj46Mw=s360",
        "resizableImageUrl": "https://lh3.googleusercontent.com/v-23hPiQYTf_Vj_NxUpW_SG5Zy0MD8b8fYrKdwGteQ4vP3wtISl9hfNi33yt6mzxqFZXhCfF-JJuW3Oq16pY0xI",
        "resizableImageHeight": 1080,
        "resizableImageWidth": 1920
      }
    },
    "content": {
      "text": [
        "Coarsely chop the frozen fruit. Place chopped fruit, fruit juice, agave, and salt in a high-powered blender. Secure the lid and process the mixture on high until the sorbet is completely smooth, thick, and creamy, 2-3 minutes, scraping the sides of the blender as needed.",
        "Taste the mixture and add more agave if desired.",
        "For a softer sorbet, serve immediately. For a firmer texture, transfer the sorbet to a freezer-safe container and freeze for 30 minutes to 1 hour. Sorbet can be frozen up to 1 week. Before serving, let soften at room temperature for about 20 minutes, or microwave for a few seconds."
      ],
