    "title": "Shortcut Butter Chicken",
    "description": "Who needs takeout when you can whip up this Shortcut Butter Chicken, which tastes as rich as its name, but is ready in 30 minutes? This north Indian curry recipe owes its popularity to a creamy tomato-based sauce, which is full of flavor but only mildly spicy, and an ideal partner for jasmine rice or garlic naan. In this recipe, the silky sauce also coats cauliflower florets, making a satisfying one-skillet meal that comes together quickly. Using rotisserie chicken as a shortcut is how to turn mouthwatering butter chicken into a quick meal that’s perfect for weekday dinners, but this dish is also a great way to use up any leftover cooked chicken.",
