    "title": "Easy Parmesan Chicken Casserole",
    "description": "This easy, creamy casserole is a great way to repurpose leftover cooked chicken or turkey. The recipe is a Yummly original created by [Sara Mellas](https://www.yummly.com/dish/author/Sara%20Mellas).",
    "images": {
      "main": "https://lh3.googleusercontent.com/HTb0hCoDECkzD83V9MT_p7NgzDVWhcrJTIoGCksRW1WWNA57LpmiqOPzMOY6nxRUWzQBlnqFbOtqmobaoI119sHr8rXzn9opfe0",
      "others": {
        "hostedLargeUrl": "https://lh3.googleusercontent.com/XNe7Wg34LVOMW6404ymCwbytsNJ44R5o6k2jTrqTzwzk9V3RhEe7CMddlwZRxW4fRqsoYI2tSeIvzB2Ud_uXbrWhnGAqKWylbUs=s360",
        "resizableImageUrl": "https://lh3.googleusercontent.com/HTb0hCoDECkzD83V9MT_p7NgzDVWhcrJTIoGCksRW1WWNA57LpmiqOPzMOY6nxRUWzQBlnqFbOtqmobaoI119sHr8rXzn9opfe0",
        "resizableImageHeight": 1399,
        "resizableImageWidth": 1399
      }
    },
    "content": {
      "text": [
        "Preheat the oven to 375°F. Spray a 9x13-inch baking dish with nonstick cooking spray. Set aside.",
        "Place the chicken in a large mixing bowl and season with the black pepper and garlic powder. Add the mayonnaise, Greek yogurt, and Parmesan cheese. Mix with a rubber spatula until thoroughly combined.",
        "Transfer the chicken mixture to the prepared baking dish and smooth it into an even layer. Sprinkle the Parmesan cheese evenly over the top.",
        "Bake the casserole on middle rack of oven until the cheese is lightly browned and the dish bubbles at the edges, 20-25 minutes.",
        "Check to see that casserole is done. Remove from oven or add time as needed.",
        "Allow casserole to rest for 10 minutes before serving. Top with parsley."
