    "title": "Honey Garlic Shrimp and Broccoli",
    "description": "Honey Garlic Shrimp and Broccoli sounds like something on a restaurant menu, doesn't it?  It does, but, you can make this garlic shrimp recipe fresh in your own kitchen, and it's so easy!  The unsalted cream of mushroom soup provides the perfect savory base, bringing together shrimp, fresh veggies and pantry staples like soy sauce, honey and crushed red pepper.  Cut your prep time by using shrimp that's already been cleaned and everything gets done in the time it takes for the rice to cook!  Or, add even more veggies and substitute cauliflower rice for the jasmine rice for an easy, healthy dinner.  Whatever you serve it with, Honey Garlic Shrimp and Broccoli tastes like you splurged on takeout!",
