  {
    "id": "33aef47f-45b5-4fbd-b5c2-6d62d061f0d2",
    "title": "Carimañolas (Baked Cassava Stuffed with Beef and Vegetables)",
    "description": "In the Caribbean region of Colombia, carimañolas are a popular appetizer made with cassava (yuca) and filled with ground beef or cheese. The fritters are traditionally deep-fried, but in this lighter version, they’re baked. Try the carimañolas as a light meal with a salad, and don’t forget the ají, a fresh Colombian hot sauce made with cilantro, onion, and hot chili. Look for frozen cassava at well-stocked grocery stores and Latin markets. Or buy fresh cassava and then cut off the bark-like peel with a sharp knife, and cut the root into pieces. The recipe is a Yummly original created by [Erica Dinho](https://www.yummly.com/dish/author/erica-dinho).",
    "images": {
      "main": "https://lh3.googleusercontent.com/f3WcoURL-3p3SE81wqTsp4Cxp2cd7DiW47dxhBPZ1HxgqM6juSMYNwJ6fpvpBCuS2rOa5NHt5vbo_PkK9lvx1NWpxNzNnmpNgnE",
      "others": {
        "hostedLargeUrl": "https://lh3.googleusercontent.com/PnHaz8Q4l2BaTiseLDeP2q_pOfVKm-PrXZsP-cE37JfbAI5ozAbRxPXrf-Do39CFoTsFgTX3PhbBVRjnTRFx_Np1yuQRip4HWg=s360",
        "resizableImageUrl": "https://lh3.googleusercontent.com/f3WcoURL-3p3SE81wqTsp4Cxp2cd7DiW47dxhBPZ1HxgqM6juSMYNwJ6fpvpBCuS2rOa5NHt5vbo_PkK9lvx1NWpxNzNnmpNgnE",
        "resizableImageHeight": 1632,
        "resizableImageWidth": 1631
      }
    },
    "content": {
      "text": [
        "Bring a large pot of salted water to a boil. Add cassava, cover, and return to a boil. Reduce heat and simmer until cassava is tender when pierced with a fork, 20-30 minutes.",
        "Meanwhile, make meat filling: In a medium saucepan, heat olive oil over medium-high heat. Add white onion, 1 scallion, and 2 tablespoons red bell pepper and cook, stirring often, until vegetables are softened, about 2 minutes. Add garlic, cumin, and 1/4 teaspoon black pepper and cook, stirring often, until garlic is softened, about 1 minute.",
        "Add ground beef and cook, stirring often and scraping up browned bits from the pan, until meat is no longer pink, 3-5 minutes. Stir in tomato paste and cook 2 more minutes. Remove filling from heat, let cool, and then season to taste with more black pepper and with salt if you like.",
        "Drain cassava, let it cool slightly, and pull out stringy fiber from the center with your fingers or a fork. Return cassava to the pot, mash with a potato masher, and then set aside until cool enough to handle.",
        "Preheat oven to 400°F. To assemble carimañolas, shape mashed cassava into 8 equal balls. Make a deep hole in the center of a ball with your thumb and place a rounded tablespoon of  meat filling in the hole. Close the cassava over the filling, moistening hands with a little water and giving the carimañola an oval shape. Set on a baking sheet. Repeat to make the remaining carimañolas.",
        "Spray carimañolas with cooking oil spray. Bake, turning carimañolas over halfway through cooking, until golden, about 30 minutes.",
        "Meanwhile, make ají: Put vinegar, water, and habanero chili in a blender and blend until very smooth, scraping inside of blender as needed, about 2 minutes. Put cilantro, tomato, remaining 3 scallions and 2 tablespoons red bell pepper, the parsley, lime juice, and 1/4 teaspoon salt in a bowl and stir to mix. Add vinegar-habanero puree to the bowl and mix well. Transfer ají to a serving bowl; or, if making it ahead, pour into a glass jar and chill, covered, up to 5 days.",
        "Serve carimañolas warm, with ají, and season to taste with additional salt if you like."
      ],
